import React, { Component } from "react";
import "./App.css";
import UploadPhoto from "./images/upload_file.png";

class App extends Component {
  state = {
    image: UploadPhoto
  };

  render() {
    return (
      <div className="main-container">
        <div className="header" id="item-1">
          <h1>Simple Inventory System</h1>
        </div>
        <table class="items-container">
          <th>
            <td>#</td>
            <td>Product Name</td>
            <td>Quantity</td>
            <td>Measurement</td>
            <td>Original Price</td>
            <td>Profit</td>
            <td>Selling Price</td>
            <td>Supplier</td>
            <td>Delete</td>
            <td>Edit</td>
          </th>
          <tr>
            <td>1</td>
            <td>Pen</td>
            <td>35</td>
            <td>Piece</td>
            <td>$25</td>
            <td>$10</td>
            <td>$35</td>
            <td>Smart Supplier</td>
            <td>Delete</td>
            <td>Edit</td>
          </tr>
        </table>
      </div>
    );
  }
}

export default App;
